import React, {Component} from 'react';
import "./Waves.css"

class Waves extends Component {
    render() {
        const colors = {background: this.props.background,
                        color: this.props.color}
        const text = this.props.text ? this.props.text : "Scooby Doo";
        const size = this.props.size;
        if (size === "small") {
            return (<button className={`${this.props.classname} buttonWaves Small`} style={colors}>
                <p>{text}</p>
                <span className={"buttonWaves__inner"}>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                </span>
            </button>);
        } else if (size === "medium") {
            return (<button className={`${this.props.classname} buttonWaves Medium`} style={colors}>
                <p>{text}</p>
                <span className={"buttonWaves__inner"}>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                </span>
            </button>);
        } else {
            return (<button className={`${this.props.classname} buttonWaves`} style={colors}>
                <p>{text}</p>
                <span className={"buttonWaves__inner"}>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                    <span className={"buttonWaves__wave"}></span>
                </span>
            </button>);
        }
    }
}

export default Waves;
